import React, { Component } from "react";

class Mitglieder extends Component {
  state = {};
  render() {
    return (
      <React.Fragment>
        <h2>Mitglieder des Bundestages</h2>
        <iframe
          src="http://localhost:8000/query2_table"
          title="Mitglieder table"
        ></iframe>
      </React.Fragment>
    );
  }
}

export default Mitglieder;
